import { GridBtn } from "../../../devComponent";
import {AvatarClient, Button, Div, Flex, Grid, Lable, memo, Icon} from "../../../importAll";

const hpIcon             = require("../../../Images/icons/32px/hp32")          
const strongIcon         = require("../../../Images/icons/32px/strong32")              
const energyIcon         = require("../../../Images/icons/32px/energy32")              
const refillEnergyIcon   = require("../../../Images/icons/32px/refillEnergy32")                  
const silverIcon         = require("../../../Images/icons/32px/silver32")              
const goldIcon           = require("../../../Images/icons/32px/gold32")          
const redPowderIcon      = require("../../../Images/icons/32px/redPowder32")              
const diamondIcon        = require("../../../Images/icons/32px/diamond32")              


const AvatarSelector = memo((props:IAvatarSelectorProps)=>{
    const deleteAvatar = ()=>{}

    return (
        <Grid className="avatarSelector" {...props} rows={15} columns={15} width="95%" height="15%" margin="10px auto" >
            <Lable bgColor className="avatarName" XYcenter start="7,1" end="11,5" rtl>{props.avatar.name}</Lable>


            <Icon bgImg={hpIcon}/>
            <Lable></Lable>


            <Div Empty className="Controll">
                <Button onClick={deleteAvatar} start="1,1" end="1,15" bgColor="red"/>
            </Div>
        </Grid>
    )
})

interface IAvatarSelectorProps extends IGlobalProps{
    avatar:AvatarClient; 
}
export default AvatarSelector;
